import '../css/Card.css';
import React from 'react';

function Card() {
  return (   
         <div class="card-container">
            <a href="http://localhost:3000/detail">
                <img src="../assets/us.jpg" alt="Mandolin" />
                <h1>Mandolin</h1>
                <p>Mandolin that is lightly used, solid construction.</p>
                <span>Price: $40</span>
            </a>
        </div>
  );
}

export default Card;
